import React from 'react';
import logo from './logo.svg';
import './App.css';
import Routes from './layout/Routes';
import {
  Link
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/dynamic-form">Form</Link>
            </li>
          </ul>
        </nav>
      </header>

      <Routes />
    </div>
  );
}

export default App;
